import React from 'react';
import propTypes from 'prop-types';
import { Helmet } from 'react-helmet';

const SEO = props => (
  <Helmet data-test="component-seo">
    <title data-test="jsx-title">{props.title}</title>
    <meta property="og:title" content={props.title} data-test="meta-title" />
    <meta property="og:url" content={props.url} data-test="meta-url" />
    <meta property="og:description" content={props.description} data-test="meta-description" />
    <meta property="og:image" content={props.image} data-test="meta-image" />
    <meta property="og:locale" content="en_IN" />
    <meta property="og:site_name" content="CrowdAlert" />
    <meta property="og:type" content="website" />
  </Helmet>
);

SEO.propTypes = {
  title: propTypes.string.isRequired,
  url: propTypes.string.isRequired,
  description: propTypes.string.isRequired,
  image: propTypes.string,
};

SEO.defaultProps = {
  title: 'No title',
  url: 'No url',
  description: 'No description',
  image: 'data:image/png;base64,%E2%80%A6',
};

export default SEO;
